";s:0:"";}i:65;a:1:{s:2:"id";s:19:"2391002297288965614";}i:66;a:1:{s:10:"short_code";s:11:"CEui-vbDT3u";}i:67;a:1:{s:12:"created_time";i:1599249706;}i:68;a:1:{s:7:"caption";s:382:"🇲🇦#pastilla#foodie #foodstagram #instafood #instagood #foodie #foodporn #restaurants #foodphoto #foodblogger #sanfrancisco #beer #beerstagram #sanfranciscofood #missionbay #littlecreatures #brewing #tajine #pizzalover #sacramento #yum #sfbesteats #brewing #bayarea #bayareaeats #bayareafoodie #sffood #eatersf #eater #yelpsf #sffoodie #bestfoodsf";}i:69;a:1:{s:14:"comments_count";i:0;}i:70;a:1:{s:11:"likes_count";i:2;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEui-vbDT3u";}i:72;a:1:{s:5:"image";s:259:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118797379_263653424893568_3572520316188957421_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=mlg-BWpzBmcAX9Y2Pk7&_nc_tp=15&oh=279cfe93898212ca0d6cd7ea3b86066b&oe=5F7CFF4C";}i:73;a:1:{s:4:"type";s:5:"image";}i:74;a:1:{s:8:"owner_id";i:36142144239;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391002256997846161";}i:79;a:1:{s:10:"short_code";s:11:"CEui-J5g4yR";}i:80;a:1:{s:12:"created_time";i:1599249702;}i:81;a:1:{s:7:"caption";s:2791:"Привіт, Фуді! 🙌⁣⁣⠀
⁣⁣⠀
Розповідайте, як пройшов ваш перший осінній тиждень? ⁣⁣⠀
⁣⁣⠀
Не знаю, як ви, а я знов хочу літо і канікули😅 ⁣⁣⠀
⁣⁣⠀
Хоча зізнатися чесно, є в осені беззаперечний плюс, це дисципліна! Час, коли все просто має бути розписано та сплановано, аби всюди встигнути та все здійснити😉⁣⁣⠀

Тому пропонуємо добрим  словом а точніше смаком зайвий раз згадати улюблене літо і пригостити себе та тих хто поруч, персиковим крамблом! Готується цей десерт швидко, а насолоди на весь день😉⁣⁣⠀
⁣⁣⠀
Тож, Вам знадобиться: 
📝6 невеликих стиглих персика ⁣⁣⠀
📝2 жменьки сирих лісових горіхів ⁣⁣⠀
📝2 ст. л. насіння льону⁣⁣⠀
📝3 ст. л. кокосової стружки ⁣⁣
📝3 ст. л. вівсяних пластівців ⁣⁣
Все змішати та перемолоти в крихту⁣⁣⠀
Персики нарізати невеликими шматочками. Додати⁣⁣⠀
📝2 ст л коричневого цукру ⁣⁣
📝1 ст л молотої кориці ⁣⁣⠀
📝5 ст л кокосової олії ⁣⁣⠀
Змішати цукор, корицю, олію та персики. Викласти в форму для запікання. Присипати підготовленою крихтою.⁣⁣⠀
Випікати 40 хвилин при температурі 200 С⁣.
Перші 20 хвилин - з вкритою фольгою, потім без - до хрумкоі скоринки. ⁣⁣⠀
⁣⁣⠀
Краще смакує ще теплим з кулькою вершкового морозива❤️
⁣⁣⠀
Зберігайте, готуйте та дивуйте себе та близьких!🙌
⁣⁣⠀
